-- DROP DATABASE runData;
CREATE DATABASE running;
USE running;

-- DESCRIBE runData;

-- SELECT * FROM runData;

CREATE TABLE runData 
(
    id	BIGINT AUTO_INCREMENT NOT NULL,
    day			VARCHAR(255),
    month		VARCHAR(255),
    dom			INT,
    year		VARCHAR(255),
    avg_pace	VARCHAR(255),
    distance	DECIMAL(4,2),
    Duration	VARCHAR(255),
    est_calories	INT,
    PRIMARY KEY (id)
);

